import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="container">
      <div className="main-content">
        <h1>Canvas 2 SVG</h1>
        <p>Desenează grafuri, UML, rețele Petri și automate online. Exportă-le ca SVG pentru web!</p>
        <div className="button-group">
          <button className="btn create">Create Account</button>
          <button className="btn login">Log In</button>
        </div>
      </div>
      <div className="sidebar">
        {/* Pozele pot fi schimbate ulterior */}
        <img src="https://images.unsplash.com/photo-1506744038136-46273834b3fb?auto=format&fit=crop&w=400&q=80" alt="Sample 1" className="side-img" />
        <img src="https://images.unsplash.com/photo-1465101046530-73398c7f28ca?auto=format&fit=crop&w=400&q=80" alt="Sample 2" className="side-img" />
      </div>
    </div>
  );
}

export default Home;
